/** 
 * This is called when client sends message to pulsar broker, before key and value gets serialized. The method calls  {@link ProducerInterceptor#beforeSend(Producer,Message)} method. Message returned fromfirst interceptor's beforeSend() is passed to the second interceptor beforeSend(), and so on in the interceptor chain. The message returned from the last interceptor is returned from this method. This method does not throw exceptions. Exceptions thrown by any interceptor methods are caught and ignored. If a interceptor in the middle of the chain, that normally modifies the message, throws an exception, the next interceptor in the chain will be called with a message returned by the previous interceptor that did not throw an exception.
 * @param producer the producer which contains the interceptor.
 * @param message the message from client
 * @return the message to send to topic/partition
 */
public Message beforeSend(Producer producer,Message message){
  Message interceptorMessage=message;
  for (  ProducerInterceptor interceptor : interceptors) {
    if (!interceptor.eligible(message)) {
      continue;
    }
    try {
      interceptorMessage=interceptor.beforeSend(producer,interceptorMessage);
    }
 catch (    Throwable e) {
      if (producer != null) {
        log.warn("Error executing interceptor beforeSend callback for topicName:{} ",producer.getTopic(),e);
      }
 else {
        log.warn("Error Error executing interceptor beforeSend callback ",e);
      }
    }
  }
  return interceptorMessage;
}
